import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab3.css';

const arr = [
  {
    name: 'Hoang',
    pfp: "https://ca.slack-edge.com/T0171J44GNS-U0187P2F5T4-b1fd59458e4a-512",
    gender: 'female',
    friend_gender: 'female',
    interest: 'coding',
    available: 'aug 8th'
  }
]

const Tab3: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>my matches</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonList>
          {arr.map(elem => (
            <IonItemSliding key={elem.name}>
              <IonItem>
                <IonAvatar slot="start">
                <img src={elem.pfp} />
                </IonAvatar>
                <IonLabel>
                    <h2>{elem.name}</h2>
                    <h3>{elem.desc}</h3>
                </IonLabel>
                </IonItem>
                <IonItemOptions side="start">
                    <IonItemOption>
                      Remove
                    </IonItemOption>
                </IonItemOptions>
            </IonItemSliding>
          ))}

        </IonList>
      </IonContent>
    </IonPage>
  );
};

export default Tab3;
